var COOKIE_ONBOARD = "onboard";

function  getOnboardCookie(){
	var cookie_string = get_cookie(COOKIE_ONBOARD);
    return cookie_string; 
}

function get_cookie ( cookie_name ){
        var re = new RegExp(cookie_name + "=([^;]+)");
            var value = re.exec(document.cookie);
            return (value != null) ? unescape(value[1]) : null;
}

$(document).ready(function(){
    function showOnboard(){
        if(getOnboardCookie()) {
            $('#nav-onboard').removeClass('hide'); 
        } else {
            $('#nav-onboard').addClass('hide');
        }
        var deviceToken = sessionStorage.deviceToken
        if(deviceToken != null) {
            $('#nav-onboard a').attr('href', '/onboard?deviceToken=' + deviceToken);
        }
    }

    showOnboard();

});
