//Header related GTM tracking
function GTMtrackInteraction(category,action,label)
{
    window.sasD360DataLayer = window.sasD360DataLayer || [];
    window.sasD360DataLayer.push({
        'event':'interaction',
        'interaction.category':category,
        'interaction.action':action,
        'interaction.label':label
    });
}

function headerTracker(){

    //on burger menu click/expand
    var toggleBurgerMenuClick = false;
    var toggleMarketSelectorClick = false;
    var toggleProfileClick = false;

    $('#burgerMenu').on("click",function(event){
        toggleBurgerMenuClick = !toggleBurgerMenuClick;
        if(toggleBurgerMenuClick){
            toggleMarketSelectorClick = false;
            toggleProfileClick = false;
            if(screen.width < 480){
                GTMtrackInteraction('Header','Main navigation','Expand mobile menu');
            } else {
                GTMtrackInteraction('Header','Main navigation','Expand desktop menu');
            }
        }
    });

    //on logo click
    $('.sas-logo a').on("click",function(event){
        GTMtrackInteraction('Header','Main navigation','Select Logo');
    });

    //on user profile click
    $('#customer-profile a').on("click",function(event){
        toggleProfileClick=!toggleProfileClick;
        if(toggleProfileClick){
            toggleMarketSelectorClick = false;
            toggleBurgerMenuClick = false;
            GTMtrackInteraction('Header','Panels','Show profile panel');
        }
    });

    //on langauge/country icon click
    $('#market-selector a').on("click",function(event){
        toggleMarketSelectorClick = !toggleMarketSelectorClick;
        if(toggleMarketSelectorClick){
            toggleProfileClick = false;
            toggleBurgerMenuClick = false;
            GTMtrackInteraction('Header','Panels','Show language panel');
        }
    });

    //on check in click //on my bookings click
    var anchorList = $('#header-primary-nav').find('a');
    
    //for Check-in link
    $(anchorList[2]).on("click",function(event){
        GTMtrackInteraction('Header','Panels','Show check in panel');
    });

    //for my-bookings link
    $(anchorList[3]).on("click",function(event){
        GTMtrackInteraction('Header','Panels','Show my trips panel');
    });
}


//banners related GTM tracking
function bannerTracker(){

    var bannerSelectors=['.smallBanner', '.mediumBanner', '.largeBanner'];
    var elems = {};
    var sortedElements = [];
    var promotions = [];

    bannerSelectors.forEach(function(selector){
        var elemList = $(selector);
        Object.keys(elemList).forEach(function(index){
            if(parseInt(index) || parseInt(index) == 0){
                var tempElem = elemList[index];
                if(tempElem){
                    /*if(tempElem.offsetHeight == 0){
                        tempElem = $(tempElem).find('.inner')[0];
                    }*/
                    var top = Math.round($(tempElem).offset().top);
                    var left = Math.round($(tempElem).offset().left);

                    if(!elems[top]){
                        elems[top] = {};
                    }
                    elems[top][left] = elemList[index];
                }
            }
        });
    });

    var temp = Object.keys(elems)
    var sortedKeys = temp.map(function(val){
        return parseInt(val);
    });

    sortedKeys.forEach(function(index) {
        var childObj = elems[index];

        var temp = Object.keys(childObj)
        var sortedChildKeys = temp.map(function(val){
            return parseInt(val);
        });

        sortedChildKeys.forEach(function(childIndex) {
            var obj = {};
            var title = $(childObj[childIndex]).find("h2,h3,h4").first().text();
            if("undefined"===typeof title || 1>title.length){
                title = ($(childObj[childIndex]).closest('.bannerWrap') && $(childObj[childIndex]).closest('.bannerWrap').attr('title')) || "no text";
            }

            obj['title'] = title;
            obj['elem'] = childObj[childIndex];
            var className = obj['elem'].className;
            if(className.indexOf('smallBanner') >= 0){
                obj['size'] = 'small';
            } else if(className.indexOf('largeBanner') >= 0){
                obj['size'] = 'large';
            } else if(className.indexOf('mediumBanner') >= 0){
                obj['size'] = 'medium';
            }

            obj['position'] = sortedElements.length + 1;

            var bannerName = title = ($(childObj[childIndex]).closest('.bannerWrap') && $(childObj[childIndex]).closest('.bannerWrap').attr('data-banner-name')) || "";

            var href = "";
            if ($(obj['elem']).find('.multiple-destination-campaign').length > 0 || $(obj['elem']).find('.hero-campaign').length > 0 ||  $(obj['elem']).find('.single-destination-hero-campaign').length > 0 || $(obj['elem']).find('.single-destination-campaign').length > 0){
                href = window.location.origin + window.location.pathname + 'lowpricecalendar/';
                var tempElem = $(obj['elem']).find('[onclick]');
                for(x=0; x<tempElem.length; x++){
                    $(tempElem[x]).on('click', onBannerClickCapture(obj));
                }
            } else if($(obj['elem']).closest('.bannerWrap').find('a').length > 0){
                href = $(obj['elem']).closest('.bannerWrap').find('a')[0].href;
                $(obj['elem']).closest('.bannerWrap').find('a').on('click', onBannerClickCapture(obj));
            }

            if(href == "#" || href == "" || href == "#."){
                href = "";
            }
            if(href.indexOf('#') > 0){
                href = href.substring(0, href.indexOf('#'));
            }

            obj['href'] = href;
            obj['manualName'] = bannerName;

            obj['propositionId'] = '';
            obj['assetId'] = '';
            
            sortedElements.push(obj);

            var promoObj = {};
            promoObj['id'] = obj.href;
            promoObj['name'] = obj.title;
            promoObj['manualName'] = obj.manualName;
            promoObj['size'] = obj.size;
            promoObj['position'] = obj.position;
            promoObj['campaignPropositionId'] = obj.propositionId;
            promoObj['campaignAssetId'] = obj.assetId;
            promotions.push(promoObj);
        });
    });

    window.sasD360DataLayer = window.sasD360DataLayer || [];
    window.sasD360DataLayer.push({
        'event': 'promoView',
        'promotions': promotions
    });

}

function onBannerClickCapture(obj){
    return function(){
        window.sasD360DataLayer = window.sasD360DataLayer || [];
        window.sasD360DataLayer.push({
            'event': 'promoClick',
            'promotionClick.id': obj.href,
            'promotionClick.name': obj.title,
            'promotionClick.manualName': obj.manualName,
            'promotionClick.size': obj.size,
            'promotionClick.position': obj.position,
            'promotionClick.campaignPropositionId':obj.propositionId,
            'promotionClick.campaignAssetId':obj.assetId
        });
    }
}
